document.getElementById("estados").onchange = function(){
  var selCidades = document.getElementById("cidades");
  selCidades.innerHTML = "";
  var cidadesFiltradas = arrayDeCidades.filter(cidade =>{
    return cidade.estado == this.value;
  });
  

  //função para tomar os dados da cidade selecionada
  document.getElementById("cidades").onclick = function(){
    //a lista de cidades so aparece ao clicar, senão caso a pessoa deseje a primeira cidade da lista, haverá problema em tomar as informações desta cidade 
    cidadesFiltradas.forEach(cidade =>{
      var optionInc = document.createElement("OPTION");
      optionInc.innerHTML = cidade.nome;
      selCidades.appendChild(optionInc);
    });


    var select = document.getElementById('cidades');
    var local = select.options[select.selectedIndex].value;
    
    
    var dados = arrayDeCidades.filter(cidade =>{
      return cidade.nome == local ;
    })

    //as informações foram tomadas do arquivo climático, dentre existentes (33), mais próximo, por distância euclidiana
    TMA = dados[0].tma;
    AMA = dados[0].ama;
    DPT = dados[0].dpt;
    DPA = dados[0].dpa;
    LAT = dados[0].lat;
    LON = dados[0].lon;
    VVENTO = dados[0].vvento;
    RAD = dados[0].radiacao;
    ZB = dados[0].zb;
    Altitude = dados[0].Altitude;

    zona_nome = document.getElementById('numero_zb')
    zona_nome.innerHTML = '0'+ZB;
  }
}








